sys_variable_value.value:
(function execute(inputs, outputs) {

    var approved_users = inputs.listOfRecords;
    var users_names = [];

    while (approved_users.next()) {
        users_names.push(approved_users.getDisplayValue('opened_by'));
    }

    outputs.members_list = users_names.join(', ');
    
})(inputs, outputs);

